import React from "react";

import {
    BrowserRouter,
    Routes,
    Route,
} from 'react-router-dom'

import Home from "../pages/Home";
import About from "../pages/About";

const Routas = () => (

    <BrowserRouter>
        <Routes>
            <Route exact path="/" component={Home}/>
            <Route exact path="/about" component={About}/>
        </Routes>
    </BrowserRouter>

)

export default Routas
